"""
User
"""

from django.db import models
from django.contrib.auth.models import AbstractUser
from django.core.validators import validate_comma_separated_integer_list

lyf = "data:image/png;base64,"


class User(AbstractUser):
    """
    Field
        - nick_name: nick name
        - follow: follow user
        - favorate
        - is_confirmed: email is confirmed
    """
    nick_name = models.CharField(max_length=20)
    institution = models.CharField(max_length=20, blank=True, null=True)
    icon = models.ImageField(upload_to="images/%Y%m/%d/icons", default=lyf)

    followers = models.ManyToManyField('User')
    favorites = models.ManyToManyField('MicroKnowledge', related_name='favorites')
    is_confirmed = models.BooleanField(default=False)
    is_sponsor = models.BooleanField(default=False, null=True)
    user_tags = models.CharField(validators=[validate_comma_separated_integer_list], max_length=70000,
                                 blank=True, null=True, default='')

    is_banned = models.BooleanField(default=False)

    class Meta(AbstractUser.Meta):
        pass

    def to_hash(self):
        rst = dict()
        rst.update({
            "id": self.id,
            "username": self.username,
        })
        return rst

    def to_hash_chat(self):
        rst = dict()
        rst.update({
            "id": self.id,
            "name": self.username,
            "email": self.email,
        })
        return rst

    def to_hash_list(self):
        rst = dict()
        rst.update({
            "user_id": self.id,
            "user_name": self.username,
            "email": self.email,
            "is_banned": self.is_banned
        })
        return rst

    def simple_to_dict(self):
        return {
            'nick_name': self.nick_name,
            'id': self.id,
            'username': self.username,
        }

    def get_fan(self):
        """
        fan: 粉丝，关注user的人
        :return: 粉丝列表
        """
        return self.user_set.all()

    def get_follower(self):
        """
        follower: user关注的人
        :return: 关注的人列表
        """
        return self.followers.all()

    def follow_by_id(self, pid):
        """
        关注另外一个用户
        :param pid: 对方用户的id
        :return: 操作是否成功: boolean
        """
        try:
            p = User.objects.get(pk=pid)
            self.followers.add(p)
            return True
        except Exception:
            return False

    def unfollow_by_id(self, pid):
        """
        解除对另一个用户的关注
        :param pid: 对方用户的id
        :return: 操作是否成功: boolean
        """
        try:
            p = User.objects.get(pk=pid)
            self.followers.remove(p)
            return True
        except Exception:
            return False

    def get_post_unsorted(self, user):
        post = []
        papers = self.create_paper.filter(is_deleted=False)
        for paper in papers:
            post.append(paper.to_hash(user))
        interpretations = self.create_interpretation.filter(is_deleted=False)
        for interpretation in interpretations:
            post.append(interpretation.to_hash(user))
        return post

    def get_post_follow_unsorted(self, user):
        followers = self.get_follower()
        recent = []
        for follower in followers:
            recent.extend(follower.get_post_unsorted(user))
        return recent

    def get_collect_unsorted(self, user):
        post = []
        papers = self.collect_paper.filter(is_deleted=False)
        for paper in papers:
            post.append(paper.to_hash(user))
        interpretations = self.collect_interpretation.filter(is_deleted=False)
        for interpretation in interpretations:
            post.append(interpretation.to_hash(user))
        return post

    def ban(self, reason):
        if Ban.objects.filter(target=self, valid=True).exists():
            return False
        new_record = Ban()
        new_record.target = self
        new_record.reason = reason
        new_record.save()
        self.is_banned = True
        self.save()
        return True

    def unban(self):
        items = Ban.objects.filter(target=self, valid=True)
        for item in items:
            item.unban()
        self.is_banned = False
        self.save()


class ConfirmString(models.Model):
    """confirm string
    Field
        - code: check code
        - user: user
    """
    code = models.CharField(max_length=5)
    email = models.CharField(max_length=50)

    def __str__(self):
        return self.email + ":   " + self.code


class Ban(models.Model):
    target = models.ForeignKey(User, on_delete=models.CASCADE, related_name='banning')
    created_at = models.DateTimeField(auto_now_add=True)
    valid = models.BooleanField(default=True)
    reason = models.CharField(max_length=200)

    def to_hash(self):
        rst = dict()
        rst.update({
            "user_id": self.target.id,
            "user_name": self.target.username,
            "email": self.target.email,
            "time": self.created_at,
            "reason": self.reason,
        })
        return rst

    def unban(self):
        self.valid = False
        self.save()